import React from "react";
import {Container, ContentSection, TitleCont, NumberCont, TextCont } from "./styles";

/*import {ReactComponent as CPUSvg} from "../../assets/svg/cpu.svg";*/

type TitleProps = {
    text: string;
    numb: string;
}
const Title = ({text, numb}: TitleProps) =>{
    return <div><NumberCont>{numb}</NumberCont><TitleCont>{text}</TitleCont></div>
}

const Text = ({children}: {children: React.ReactNode})=>{
    return <TextCont>{children}</TextCont>
}
const WhatIs:React.FC = ()=>{
    return(
        <ContentSection>
            <Container>

                <TextCont text = "Testando"numb = "1"></TextCont>
            </Container>
        </ContentSection>
    );
}

export default WhatIs;
